INSERT INTO `sessions` VALUES ('1', '1', 'Monday:\r\n\r\nI exercised really hard even though...', 'Ok good so you will need to do a little more and be careful about ...', '2014-04-23 18:18:54'), ('3', '3', 'Wednesday:\r\n\r\n4 set leg press\r\n3 set bench press\r\n', 'You should not mix leg days with pec days. The both are big muscles and you should choose one and take a break for a day between them.', '2014-03-28 01:47:54'), ('6', '6', 'Saturday', null, '2014-03-20 20:15:50'), ('14', '5', 'Friday I did back and biceps. I started with 3 sets of chin ups. After that i did 3 sets of bent over rows which was until failure. Then again, I did 3 sets of pull down. So this was my back. For biceps I started with 3 sets of barbell curl and then 4 sets of dumbbell curl. After that, I did 4 sets of pull ups and I finished after 1 hour exercising.', null, '2014-04-05 18:31:34'), ('20', '1', 'On Wednesday i did back and biceps...', 'Good job!', '2014-05-01 21:00:51'), ('21', '1', 'On Friday I did chests and triceps...', null, '2014-05-01 02:41:45'), ('22', '1', 'On Sunday I did a little of light cardio', null, '2014-05-01 02:42:10'), ('23', '3', 'Based on the program you\'ve given me I did a light cardio at the weekends...', null, '2014-05-01 02:45:52');
COMMIT;

